(158, 1, '2018-11-01 16:49:41', '2018-11-01 16:49:41', '<h3>Featured Classes</h3>		\n			<h2>Strength & stamina</h2>		\n		<p>In FitFlex\'s Strength and Stamina class, we will delve deep into building the fittest body you can. The class aims to not only shape you up, but also instruct and inform you in the right methods to do weightlifting and working out.</p>		\n			<a href=\"#\" role=\"button\">\n						Sign up\n					</a>\n			<h2>Flexibility postures</h2>		\n		<p>Learn how to maintain a comfortable and healthy posture, with our comprehensive class that goes through the most popular Yoga and Pilates postures. These postures are gears to make your body more flexibile and agile.</p>		\n			<a href=\"#\" role=\"button\">\n						Sign up\n					</a>\n			<h2>achieving your goals</h2>		\n		<p>Getting in shape forces you to face your biggest challenges, and sticking to a regular routine for a long period of time. This class will make sure you know how to focus on the right exercises and workouts to reach your goals. </p>		\n			<a href=\"#\" role=\"button\">\n						Sign up\n					</a>', 'Q8 – Features Boxes Left Image Right Text with CTA', '', 'publish', 'closed', 'closed', '', 'q8-features-boxes-left-image-right-text-with-cta', '', '', '2018-11-01 16:49:41', '2018-11-01 16:49:41', '', 0, 'http://localhost/Alevel/?elementor_library=q8-features-boxes-left-image-right-text-with-cta', 0, 'elementor_library', '', 0),
